import React from "react";
import "./Sidebar.css"; // Add styles here

const Sidebar = () => {
  return (
    <div className="sidebar">
      <h3>Navigation</h3>
      <nav>
        <ul>
          <li><a href="#">Upload & Process</a></li>
          <li><a href="#">View Results</a></li>
          <li><a href="#">About</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default Sidebar;
